"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F86990&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
