"    <li class=\"dashItem\">",
"     <a class=\"outlineLink\" href=\"#H6\">",
"      - Chemical contaminant assays",
"     </a>",
"    </li>",
"    <li class=\"dashItem\">",
"     <a class=\"outlineLink\" href=\"#H7\">",
"      - Microbial contaminant assays",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#H8\">",
"      MONITORING OF SPECIFIC PURIFICATION PROCESSES",
"     </a>",
"    </li>",
"    <li class=\"bulletItem\">",
"     <a class=\"outlineLink\" href=\"#H9\">",
"      Reverse osmosis",
"     </a>",
"    </li>",
"    <li class=\"bulletItem\">",
"     <a class=\"outlineLink\" href=\"#H10\">",
"      Deionizers",
"     </a>",
"    </li>",
"    <li class=\"bulletItem\">",
"     <a class=\"outlineLink\" href=\"#H11\">",
"      Carbon",
"     </a>",
